import React from 'react';

const CompletedProjects = ({ projects, title }) => {
  return (
    <div style={{ marginTop: '40px' }}>
      <h2>{title}</h2>
      <ul>
        {projects.map((project, index) => (
          <li key={index}>
            {/* If it's an AllProjects array, show project name only */}
            {project.AllProjects ? (
              <div>{project.AllProjects}</div>
            ) : (
              Object.entries(project).map(([key, value]) => (
                <div key={key}>
                  <strong>{key}:</strong> {value}
                </div>
              ))
            )}
            <hr />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CompletedProjects;
